import React from 'react';
import classes from './footer.module.css';

function Footer(props) {
    return(
        <div className={classes.footr}>
            <div>
                <ul>ONLINE SHOPPING
                    <li>Men</li>
                    <li>Women</li>
                    <li>Kids</li>
                </ul>
                <ul>CUSTOMER POLICIES
                    <li>Contact Us</li>
                    <li>FAQ</li>
                    <li>Terms & Conditions</li>
                    <li>Terms of Use</li>
                    <li>Track Orders</li>
                    <li>Cancellation</li>
                    <li>Privacy Policy</li>
                </ul>
            </div>
        </div>
    );
}

export default Footer;
